import React from 'react'
import { Field } from 'formik'

const SelectCity = ({ as, name, options }) => {
    return (
        <div className="form-control">

            <Field>
                {
                    options.map(option => {
                        return(
                            <option
                            key={option.value}
                            value={option.value}
                            >
                                {option.key}

                            </option>
                        )

                    })
                }
            </Field>
        </div>
    )
}

export default SelectCity
